class PreprocessorInstruction {
    constructor() {
        this._start = 0
        this._end = 0
    }
    getType() {
        return TYPE.UNKNOWN
    }

    set start(inStart) {
        this._start = inStart
    }

    set end(inEnd) {
        this._end = inEnd;
    }
}

const TYPE = {
    REF: 'REF',
    INCLUDE: 'INCLUDE',
    UNKNOWN: 'UNKNOWN'
}

exports.PreprocessorInstruction = PreprocessorInstruction
exports.TYPE = TYPE
